Compile them:  
# gcc myecho.c -o myecho
# gcc execve.c -o execve
Observer the output of using -b:  
# strace -b execve ./execve myecho
execve("./execve", ["./execve", "myecho"], 0x7ffe49f7edf8 /* 21 vars */) = 0
