The log shows that strace detached the process once execve is executed. -b can be combined use with -f to ignore some insignificant child processes during debugging (please refer Trace child processes section).

posts/change-environment-variables-value.body:
Change environment variables' values
-E option is used to change environment variables' values. Actually, strace just calls putenv() function (code is here). Check following code:  
# cat env_test.c
#include 
#include 

int main(void)
{
    char *p = NULL;
    if (p = getenv("HG"))
    {
        printf("HG enviromental variable value is %s\n", p);
    }
    else
    {
        printf("HG enviromental variable value is not set\n");
    }
    return 0;
}
Build and run it:  
#  gcc env_test.c -o env_test
# ./env_test
HG enviromental variable value is /usr/bin/hg
Set HG to other value:  
# strace -E "HG=git" ./env_test
......
write(1, "HG enviromental variable value i"..., 38HG enviromental variable value is git
) = 38
......
Remove HG:  
# strace -E "HG" ./env_test
......
write(1, "HG enviromental variable value i"..., 42HG enviromental variable value is not set
) = 42
......

posts/run-command-as-other-user.html.body:
Run command as other user
-u username option can run command as other user, and this option only take effect when executing as root. Check following example:  
# cat getuid.c
#include 
#include 
#include 

int main(void)
{
    printf("uid is %d\n", getuid());
    return 0;
}
Build and run it as root:  
# gcc getuid.c -o getuid
# strace ./getuid
execve("./getuid", ["./getuid"], 0x7ffce778f8a0 /* 12 vars */) = 0
brk(NULL)                               = 0x563fe210a000
......
write(1, "uid is 0\n", 9uid is 0
)               = 9
exit_group(0)                           = ?
+++ exited with 0 +++
It shows uid is 0. Run the program as another user:  
# strace -u nan ./getuid
......
write(1, "uid is 1000\n", 12uid is 1000
)           = 12
exit_group(0)                           = ?
+++ exited with 0 +++
This time, uid is 1000.
